<script src="https://d3js.org/d3.v4.min.js"></script>
<script>

var formatPercent = d3.format(".0"),
    formatNumber = d3.format(".0f");

var threshold = d3.scaleThreshold()
    .domain([1, Math.sqrt(10), Math.sqrt(50), Math.sqrt(200), Math.sqrt(500), Math.sqrt(1000), Math.sqrt(2000), Math.sqrt(4000)])
    .range(["#fff7ec","#fee8c8","#fdd49e","#fdbb84","#fc8d59","#ef6548","#d7301f","#b30000","#7f0000"]);

var x = d3.scaleLinear()
    .domain([0, Math.sqrt(4500)])
    .range([0, 500]);

var xAxis = d3.axisBottom(x)
    .tickSize(13)
    .tickValues(threshold.domain())
    .tickFormat(function(d) { return d === 0.5 ? formatPercent(d) : formatNumber(d*d); });

var g = d3.select("g").call(xAxis);

g.select(".domain")
    .remove();

g.selectAll("rect")
  .data(threshold.range().map(function(color) {
    var d = threshold.invertExtent(color);
    if (d[0] == null) d[0] = x.domain()[0];
    if (d[1] == null) d[1] = x.domain()[1];
    return d;
  }))
  .enter().insert("rect", ".tick")
    .attr("height", 8)
    .attr("x", function(d) { return x(d[0]); })
    .attr("width", function(d) { return x(d[1]) - x(d[0]); })
    .attr("fill", function(d) { return threshold(d[0]); });

g.append("text")
    .attr("fill", "#000")
    .attr("font-weight", "bold")
    .attr("text-anchor", "start")
    .attr("y", -6)
    .text("Percentage of stops that involved force");

</script>
